import { Fragment } from "react";
import FacturasTemplate from "../Templates/FacturaTemplate";
import { BrowserRouter } from "react-router-dom";

const FacturasTemplates = () => {
    return (
            <BrowserRouter>
        <Fragment>
                <FacturasTemplate />
        </Fragment>
            </BrowserRouter>
    );
};
export default FacturasTemplates;
